import React from 'react';
import './index1.css'
import Button from 'react-bootstrap/esm/Button';
function Titles1({word}) {
  return (
 <Button style={{
    bordercolor: 'black',
    borderradius: '10px',
    backgroundcolor: '#d9c1e0',
    border: 'solid 5px',
    borderwidth: '12%',
    height: '50px',
    width: '350px',
  }} >{word}</Button>       
  );
}

export default Titles1;
